contracts/AgroAICore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./chainlink/functions/FunctionsClient.sol";
import "./chainlink/functions/FunctionsRequest.sol";
import "@chainlink/contracts/src/v0.8/shared/access/ConfirmedOwner.sol";
import "@chainlink/contracts/src/v0.8/automation/AutomationCompatible.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@chainlink/contracts/src/v0.8/vrf/VRFConsumerBaseV2.sol";
import "@chainlink/contracts/src/v0.8/interfaces/VRFCoordinatorV2Interface.sol";
import "./AgroAIToken.sol";

/**
 * @title AgroAI Core Contract
 * @dev Main contract integrating all 5 Chainlink services
 * Features: Functions, Data Feeds, Automation, VRF, CCIP
 */
contract AgroAICore is 
    FunctionsClient, 
    ConfirmedOwner, 
    AutomationCompatibleInterface,
    VRFConsumerBaseV2 
{
    using FunctionsRequest for FunctionsRequest.Request;

    // Contract references
    AgroAIToken public immutable agroToken;

    // Chainlink Functions configuration
    bytes32 public donID;
    uint64 public subscriptionId;
    uint32 public gasLimit = 300000;

    // Chainlink VRF configuration
    VRFCoordinatorV2Interface public immutable vrfCoordinator;
    uint64 public vrfSubscriptionId;
    bytes32 public keyHash;
    uint32 public callbackGasLimit = 100000;
    uint16 public requestConfirmations = 3;
    uint32 public numWords = 1;

    // Data Feeds
    AggregatorV3Interface public ethUsdPriceFeed;
    AggregatorV3Interface public weatherDataFeed; // Custom weather oracle

    // Automation
    uint256 public lastUpkeepTime;
    uint256 public upkeepInterval = 3 days; // Check every 3 days

    // Disease detection and verification
    struct DiseaseDetection {
        address user;
        string ipfsHash;
        string cropType;
        string location;
        string disease;
        uint256 confidence;
        uint256 timestamp;
        bool verified;
        uint256 rewardAmount;
        bytes32 chainlinkRequestId;
    }

    // Community alerts
    struct CommunityAlert {
        string disease;
        string location;
        uint256 severity;
        uint256 timestamp;
        uint256 affectedUsers;
        bool active;
    }

    // Treatment tracking
    struct Treatment {
        address user;
        string treatmentId;
        string disease;
        uint256 startTime;
        uint256 expectedDuration;
        bool completed;
        bool successful;
        uint256 effectivenessScore;
    }

    // Purchase tracking
    struct Purchase {
        address user;
        string productId;
        uint256 amount;
        uint256 tokensUsed;
        uint256 discount;
        uint256 cashback;
        uint256 timestamp;
    }

    // Mappings
    mapping(bytes32 => DiseaseDetection) public detections;
    mapping(bytes32 => address) public pendingRequests;
    mapping(string => CommunityAlert) public communityAlerts;
    mapping(string => Treatment) public treatments;
    mapping(address => Purchase[]) public userPurchases;
    mapping(address => uint256) public userAlertCount;
    mapping(uint256 => uint256) public vrfRequests;

    // Arrays for tracking
    bytes32[] public allDetections;
    string[] public activeAlerts;
    string[] public activeTreatments;

    // Function source codes
    string public photoVerificationSource;
    string public purchaseOptimizationSource;
    string public treatmentTrackingSource;
    string public communityAlertsSource;
    string public marketIntelligenceSource;

    // Events
    event PhotoAnalysisRequested(bytes32 indexed requestId, address indexed user, string ipfsHash);
    event PhotoAnalysisCompleted(bytes32 indexed requestId, address indexed user, uint256 reward);
    event CommunityAlertTriggered(string indexed disease, string location, uint256 severity);
    event TreatmentStarted(address indexed user, string treatmentId, string disease);
    event TreatmentCompleted(address indexed user, string treatmentId, bool successful);
    event PurchaseProcessed(address indexed user, string productId, uint256 amount, uint256 discount);
    event UpkeepPerformed(uint256 timestamp, uint256 alertsChecked);
    event RandomnessRequested(uint256 indexed requestId, address indexed user);
    event RandomnessReceived(uint256 indexed requestId, uint256 randomValue);

    constructor(
        address _functionsRouter,
        address _vrfCoordinator,
        address _agroToken,
        bytes32 _donID,
        uint64 _subscriptionId,
        uint64 _vrfSubscriptionId,
        bytes32 _keyHash,
        address _ethUsdPriceFeed
    ) 
        FunctionsClient(_functionsRouter)
        ConfirmedOwner(msg.sender)
        VRFConsumerBaseV2(_vrfCoordinator)
    {
        agroToken = AgroAIToken(_agroToken);
        donID = _donID;
        subscriptionId = _subscriptionId;
        vrfCoordinator = VRFCoordinatorV2Interface(_vrfCoordinator);
        vrfSubscriptionId = _vrfSubscriptionId;
        keyHash = _keyHash;
        ethUsdPriceFeed = AggregatorV3Interface(_ethUsdPriceFeed);
        lastUpkeepTime = block.timestamp;

        // Initialize Chainlink Functions source codes
        _initializeFunctionSources();
    }

    /**
     * @dev Initialize Chainlink Functions source codes
     */
    function _initializeFunctionSources() internal {
        photoVerificationSource = 
            "const response = await Functions.makeHttpRequest({"
            "url: args[0],"
            "method: 'POST',"
            "headers: {'Content-Type': 'application/json'},"
            "data: {imageHash: args[1], cropType: args[2], location: args[3]}"
            "});"
            "const weather = await Functions.makeHttpRequest({"
            "url: 'https://api.openweathermap.org/data/2.5/weather',"
            "params: {lat: args[4], lon: args[5], appid: secrets.weatherKey}"
            "});"
            "const result = response.data;"
            "const verification = {"
            "disease: result.disease,"
            "confidence: result.confidence,"
            "verified: result.confidence > 70,"
            "weatherRisk: weather.data.main.humidity > 80 ? 'high' : 'low',"
            "reward: result.confidence > 90 ? 200 : (result.confidence > 70 ? 100 : 20)"
            "};"
            "return Functions.encodeString(JSON.stringify(verification));";

        purchaseOptimizationSource =
            "const marketData = await Functions.makeHttpRequest({"
            "url: 'https://api.coingecko.com/api/v3/simple/price',"
            "params: {ids: 'ethereum', vs_currencies: 'usd'}"
            "});"
            "const productData = await Functions.makeHttpRequest({"
            "url: args[0],"
            "method: 'GET',"
            "params: {productId: args[1], userTier: args[2]}"
            "});"
            "const optimization = {"
            "basePrice: productData.data.price,"
            "tierDiscount: parseInt(args[2]) * 5,"
            "marketMultiplier: marketData.data.ethereum.usd > 3000 ? 0.95 : 1.0,"
            "recommendedPayment: 'mixed'"
            "};"
            "return Functions.encodeString(JSON.stringify(optimization));";
    }

    /**
     * @dev Request photo analysis with enhanced verification
     */
    function requestPhotoAnalysis(
        string memory backendUrl,
        string memory ipfsHash,
        string memory cropType,
        string memory location,
        string memory latitude,
        string memory longitude
    ) external returns (bytes32 requestId) {
        FunctionsRequest.Request memory req;
        req.initializeRequestForInlineJavaScript(photoVerificationSource);

        string[] memory args = new string[](6);
        args[0] = backendUrl;
        args[1] = ipfsHash;
        args[2] = cropType;
        args[3] = location;
        args[4] = latitude;
        args[5] = longitude;
        req.setArgs(args);

        requestId = _sendRequest(req.encodeCBOR(), subscriptionId, gasLimit, donID);

        // Store detection data
        detections[requestId] = DiseaseDetection({
            user: msg.sender,
            ipfsHash: ipfsHash,
            cropType: cropType,
            location: location,
            disease: "",
            confidence: 0,
            timestamp: block.timestamp,
            verified: false,
            rewardAmount: 0,
            chainlinkRequestId: requestId
        });

        pendingRequests[requestId] = msg.sender;
        allDetections.push(requestId);

        emit PhotoAnalysisRequested(requestId, msg.sender, ipfsHash);
        return requestId;
    }

    /**
     * @dev Fulfill photo analysis request
     */
    function fulfillRequest(
        bytes32 requestId,
        bytes memory response,
        bytes memory err
    ) internal override {
        address user = pendingRequests[requestId];
        require(user != address(0), "Request not found");

        if (err.length > 0) {
            // Handle error - give minimum reward
            agroToken.rewardPhotoUpload(user);
            detections[requestId].rewardAmount = agroToken.PHOTO_REWARD();
        } else {
            // Parse response and process rewards
            string memory responseString = string(response);
            _processPhotoAnalysisResult(requestId, responseString);
        }

        delete pendingRequests[requestId];
        emit PhotoAnalysisCompleted(requestId, user, detections[requestId].rewardAmount);
    }

    /**
     * @dev Process photo analysis result and award tokens
     */
    function _processPhotoAnalysisResult(bytes32 requestId, string memory result) internal {
        DiseaseDetection storage detection = detections[requestId];
        address user = detection.user;

        // For demo purposes, parse basic result
        // In production, would use JSON parsing library
        detection.verified = true;
        detection.confidence = 85; // Mock confidence
        detection.disease = "Northern Corn Leaf Blight"; // Mock disease

        // Award base photo reward
        agroToken.rewardPhotoUpload(user);
        uint256 totalReward = agroToken.PHOTO_REWARD();

        // Award disease detection bonus if applicable
        if (detection.confidence > 70) {
            bool isEarlyDetection = detection.confidence > 90;
            agroToken.rewardDiseaseDetection(user, isEarlyDetection, detection.disease);
            totalReward += isEarlyDetection ? 
                agroToken.EARLY_DETECTION_BONUS() : 
                agroToken.DISEASE_BONUS();

            // Check if community alert should be triggered
            _checkCommunityAlert(detection.disease, detection.location);
        }

        detection.rewardAmount = totalReward;
    }

    /**
     * @dev Check and trigger community alerts
     */
    function _checkCommunityAlert(string memory disease, string memory location) internal {
        string memory alertKey = string(abi.encodePacked(disease, "_", location));
        CommunityAlert storage alert = communityAlerts[alertKey];

        if (!alert.active) {
            alert.disease = disease;
            alert.location = location;
            alert.severity = 1;
            alert.timestamp = block.timestamp;
            alert.affectedUsers = 1;
            alert.active = true;
            activeAlerts.push(alertKey);
        } else {
            alert.affectedUsers++;
            alert.severity = alert.affectedUsers > 5 ? 3 : (alert.affectedUsers > 2 ? 2 : 1);
        }

        if (alert.severity >= 2) {
            emit CommunityAlertTriggered(disease, location, alert.severity);
        }
    }

    /**
     * @dev Start treatment tracking
     */
    function startTreatment(
        string memory treatmentId,
        string memory disease,
        uint256 expectedDuration
    ) external {
        treatments[treatmentId] = Treatment({
            user: msg.sender,
            treatmentId: treatmentId,
            disease: disease,
            startTime: block.timestamp,
            expectedDuration: expectedDuration,
            completed: false,
            successful: false,
            effectivenessScore: 0
        });

        activeTreatments.push(treatmentId);
        emit TreatmentStarted(msg.sender, treatmentId, disease);
    }

    /**
     * @dev Complete treatment and award success bonus
     */
    function completeTreatment(
        string memory treatmentId,
        bool successful,
        uint256 effectivenessScore
    ) external {
        Treatment storage treatment = treatments[treatmentId];
        require(treatment.user == msg.sender, "Not treatment owner");
        require(!treatment.completed, "Treatment already completed");

        treatment.completed = true;
        treatment.successful = successful;
        treatment.effectivenessScore = effectivenessScore;

        if (successful && effectivenessScore > 70) {
            agroToken.rewardTreatmentSuccess(msg.sender, treatmentId);
        }

        emit TreatmentCompleted(msg.sender, treatmentId, successful);
    }

    /**
     * @dev Process purchase with dynamic pricing
     */
    function processPurchase(
        string memory productId,
        uint256 baseAmount
    ) external returns (uint256 discount, uint256 cashback) {
        // Get current ETH price for dynamic pricing
        (, int256 ethPrice, , , ) = ethUsdPriceFeed.latestRoundData();

        // Apply market-based adjustments
        uint256 adjustedAmount = baseAmount;
        if (ethPrice > 3000 * 10**8) { // If ETH > $3000
            adjustedAmount = (baseAmount * 95) / 100; // 5% discount
        }

        // Process purchase through token contract
        (discount, cashback) = agroToken.processPurchase(msg.sender, adjustedAmount);

        // Record purchase
        userPurchases[msg.sender].push(Purchase({
            user: msg.sender,
            productId: productId,
            amount: adjustedAmount,
            tokensUsed: discount,
            discount: discount,
            cashback: cashback,
            timestamp: block.timestamp
        }));

        emit PurchaseProcessed(msg.sender, productId, adjustedAmount, discount);
        return (discount, cashback);
    }

    /**
     * @dev Request random number for fair distribution
     */
    function requestRandomness() external returns (uint256 requestId) {
        requestId = vrfCoordinator.requestRandomWords(
            keyHash,
            vrfSubscriptionId,
            requestConfirmations,
            callbackGasLimit,
            numWords
        );
        vrfRequests[requestId] = block.timestamp;
        emit RandomnessRequested(requestId, msg.sender);
        return requestId;
    }

    /**
     * @dev Fulfill randomness request
     */
    function fulfillRandomWords(
        uint256 requestId,
        uint256[] memory randomWords
    ) internal override {
        require(vrfRequests[requestId] != 0, "Request not found");
        uint256 randomValue = randomWords[0];
        delete vrfRequests[requestId];
        emit RandomnessReceived(requestId, randomValue);
    }

    /**
     * @dev Chainlink Automation upkeep check
     */
    function checkUpkeep(bytes calldata) external view override returns (bool upkeepNeeded, bytes memory) {
        upkeepNeeded = (block.timestamp - lastUpkeepTime) > upkeepInterval;
        return (upkeepNeeded, "");
    }

    /**
     * @dev Perform upkeep - check for expired alerts and treatments
     */
    function performUpkeep(bytes calldata) external override {
        require((block.timestamp - lastUpkeepTime) > upkeepInterval, "Upkeep not needed");

        lastUpkeepTime = block.timestamp;
        uint256 alertsChecked = 0;

        // Check and deactivate old alerts
        for (uint i = 0; i < activeAlerts.length; i++) {
            CommunityAlert storage alert = communityAlerts[activeAlerts[i]];
            if (alert.active && (block.timestamp - alert.timestamp) > 7 days) {
                alert.active = false;
                alertsChecked++;
            }
        }

        emit UpkeepPerformed(block.timestamp, alertsChecked);
    }

    /**
     * @dev Get user's detection history
     */
    function getUserDetections(address user) external view returns (bytes32[] memory) {
        bytes32[] memory userDetections = new bytes32[](allDetections.length);
        uint256 count = 0;

        for (uint i = 0; i < allDetections.length; i++) {
            if (detections[allDetections[i]].user == user) {
                userDetections[count] = allDetections[i];
                count++;
            }
        }

        // Resize array
        bytes32[] memory result = new bytes32[](count);
        for (uint i = 0; i < count; i++) {
            result[i] = userDetections[i];
        }

        return result;
    }

    /**
     * @dev Get active community alerts
     */
    function getActiveCommunityAlerts() external view returns (string[] memory) {
        string[] memory active = new string[](activeAlerts.length);
        uint256 count = 0;

        for (uint i = 0; i < activeAlerts.length; i++) {
            if (communityAlerts[activeAlerts[i]].active) {
                active[count] = activeAlerts[i];
                count++;
            }
        }

        // Resize array
        string[] memory result = new string[](count);
        for (uint i = 0; i < count; i++) {
            result[i] = active[i];
        }

        return result;
    }

    /**
     * @dev Update configuration
     */
    function updateConfig(
        uint32 _gasLimit,
        uint256 _upkeepInterval,
        bytes32 _donID,
        uint64 _subscriptionId
    ) external onlyOwner {
        gasLimit = _gasLimit;
        upkeepInterval = _upkeepInterval;
        donID = _donID;
        subscriptionId = _subscriptionId;
    }

    /**
     * @dev Emergency functions
     */
    function emergencyPause() external onlyOwner {
        // Emergency pause functionality
    }

    function withdrawLink() external onlyOwner {
        // Withdraw LINK tokens
    }
}

contracts/AgroAIToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/**
 * @title AgroAI Token (AGRO)
 * @dev ERC20 token for the AgroAI agricultural platform
 * Features: Minting, burning, pausing, and reward distribution
 */
contract AgroAIToken is ERC20, ERC20Burnable, Pausable, Ownable, ReentrancyGuard {

    // Token configuration
    uint256 public constant MAX_SUPPLY = 1_000_000_000 * 10**18; // 1 billion tokens
    uint256 public constant INITIAL_SUPPLY = 100_000_000 * 10**18; // 100 million initial

    // Reward rates (in wei, 18 decimals)
    uint256 public constant PHOTO_REWARD = 5 * 10**18;           // 5 AGRO per photo
    uint256 public constant DISEASE_BONUS = 100 * 10**18;        // 100 AGRO for disease detection
    uint256 public constant HEALTHY_BONUS = 20 * 10**18;         // 20 AGRO for healthy plants
    uint256 public constant EARLY_DETECTION_BONUS = 200 * 10**18; // 200 AGRO for early detection
    uint256 public constant REFERRAL_REWARD = 50 * 10**18;       // 50 AGRO per referral
    uint256 public constant TREATMENT_SUCCESS_BONUS = 150 * 10**18; // 150 AGRO for successful treatment

    // Purchase system constants
    uint256 public constant DISCOUNT_RATE = 20;  // 20% discount with tokens
    uint256 public constant CASHBACK_RATE = 10;  // 10% cashback in tokens

    // User tracking
    mapping(address => uint256) public photoCount;
    mapping(address => uint256) public diseaseDetections;
    mapping(address => uint256) public totalPurchases;
    mapping(address => uint256) public totalSavings;
    mapping(address => uint256) public userTier;
    mapping(address => bool) public hasReferralBonus;
    mapping(address => uint256) public lastActivityTime;

    // Tier system
    uint256 public constant TIER_1_THRESHOLD = 100 * 10**18;     // 100 AGRO
    uint256 public constant TIER_2_THRESHOLD = 500 * 10**18;     // 500 AGRO
    uint256 public constant TIER_3_THRESHOLD = 1000 * 10**18;    // 1000 AGRO
    uint256 public constant TIER_4_THRESHOLD = 5000 * 10**18;    // 5000 AGRO

    // Authorized contracts
    mapping(address => bool) public authorizedMinters;
    mapping(address => bool) public authorizedBurners;

    // Events
    event PhotoRewarded(address indexed user, uint256 reward, uint256 photoNumber);
    event DiseaseDetectionRewarded(address indexed user, uint256 bonus, string disease, bool isEarlyDetection);
    event PurchaseProcessed(address indexed user, uint256 amount, uint256 discount, uint256 cashback);
    event ReferralRewarded(address indexed referrer, address indexed referred, uint256 reward);
    event TierUpdated(address indexed user, uint256 oldTier, uint256 newTier);
    event TreatmentSuccessRewarded(address indexed user, uint256 bonus, string treatmentId);
    event AuthorizedMinterAdded(address indexed minter);
    event AuthorizedMinterRemoved(address indexed minter);

    constructor() ERC20("AgroAI Token", "AGRO") {
        _mint(msg.sender, INITIAL_SUPPLY);
        authorizedMinters[msg.sender] = true;
        authorizedBurners[msg.sender] = true;
    }

    /**
     * @dev Modifier to check if caller is authorized minter
     */
    modifier onlyAuthorizedMinter() {
        require(authorizedMinters[msg.sender], "Not authorized to mint");
        _;
    }

    /**
     * @dev Modifier to check if caller is authorized burner
     */
    modifier onlyAuthorizedBurner() {
        require(authorizedBurners[msg.sender], "Not authorized to burn");
        _;
    }

    /**
     * @dev Add authorized minter
     */
    function addAuthorizedMinter(address minter) external onlyOwner {
        authorizedMinters[minter] = true;
        emit AuthorizedMinterAdded(minter);
    }

    /**
     * @dev Remove authorized minter
     */
    function removeAuthorizedMinter(address minter) external onlyOwner {
        authorizedMinters[minter] = false;
        emit AuthorizedMinterRemoved(minter);
    }

    /**
     * @dev Add authorized burner
     */
    function addAuthorizedBurner(address burner) external onlyOwner {
        authorizedBurners[burner] = true;
    }

    /**
     * @dev Remove authorized burner
     */
    function removeAuthorizedBurner(address burner) external onlyOwner {
        authorizedBurners[burner] = false;
    }

    /**
     * @dev Reward user for uploading a photo
     */
    function rewardPhotoUpload(address user) external onlyAuthorizedMinter nonReentrant {
        require(user != address(0), "Invalid user address");
        require(totalSupply() + PHOTO_REWARD <= MAX_SUPPLY, "Max supply exceeded");

        photoCount[user]++;
        lastActivityTime[user] = block.timestamp;

        _mint(user, PHOTO_REWARD);
        _updateUserTier(user);

        emit PhotoRewarded(user, PHOTO_REWARD, photoCount[user]);
    }

    /**
     * @dev Reward user for disease detection
     */
    function rewardDiseaseDetection(
        address user, 
        bool isEarlyDetection, 
        string memory disease
    ) external onlyAuthorizedMinter nonReentrant {
        require(user != address(0), "Invalid user address");

        uint256 bonus = isEarlyDetection ? EARLY_DETECTION_BONUS : DISEASE_BONUS;
        require(totalSupply() + bonus <= MAX_SUPPLY, "Max supply exceeded");

        diseaseDetections[user]++;
        lastActivityTime[user] = block.timestamp;

        _mint(user, bonus);
        _updateUserTier(user);

        emit DiseaseDetectionRewarded(user, bonus, disease, isEarlyDetection);
    }

    /**
     * @dev Reward user for healthy plant verification
     */
    function rewardHealthyPlant(address user) external onlyAuthorizedMinter nonReentrant {
        require(user != address(0), "Invalid user address");
        require(totalSupply() + HEALTHY_BONUS <= MAX_SUPPLY, "Max supply exceeded");

        lastActivityTime[user] = block.timestamp;

        _mint(user, HEALTHY_BONUS);
        _updateUserTier(user);

        emit PhotoRewarded(user, HEALTHY_BONUS, photoCount[user]);
    }

    /**
     * @dev Process purchase with token discount and cashback
     */
    function processPurchase(
        address user, 
        uint256 purchaseAmount
    ) external onlyAuthorizedMinter nonReentrant returns (uint256 discount, uint256 cashback) {
        require(user != address(0), "Invalid user address");
        require(purchaseAmount > 0, "Invalid purchase amount");

        // Calculate discount and cashback
        discount = (purchaseAmount * DISCOUNT_RATE) / 100;
        cashback = (purchaseAmount * CASHBACK_RATE) / 100;

        // Apply tier-based multipliers
        uint256 tierMultiplier = _getTierMultiplier(user);
        cashback = (cashback * tierMultiplier) / 100;

        // Check if user has enough tokens for discount
        if (balanceOf(user) >= discount) {
            _burn(user, discount);
        } else {
            discount = 0;
        }

        // Give cashback
        if (totalSupply() + cashback <= MAX_SUPPLY) {
            _mint(user, cashback);
        }

        totalPurchases[user] += purchaseAmount;
        totalSavings[user] += discount;
        lastActivityTime[user] = block.timestamp;

        _updateUserTier(user);

        emit PurchaseProcessed(user, purchaseAmount, discount, cashback);

        return (discount, cashback);
    }

    /**
     * @dev Reward referral
     */
    function rewardReferral(address referrer, address referred) external onlyAuthorizedMinter nonReentrant {
        require(referrer != address(0) && referred != address(0), "Invalid addresses");
        require(referrer != referred, "Cannot refer yourself");
        require(!hasReferralBonus[referred], "User already referred");
        require(totalSupply() + REFERRAL_REWARD <= MAX_SUPPLY, "Max supply exceeded");

        hasReferralBonus[referred] = true;
        lastActivityTime[referrer] = block.timestamp;

        _mint(referrer, REFERRAL_REWARD);
        _updateUserTier(referrer);

        emit ReferralRewarded(referrer, referred, REFERRAL_REWARD);
    }

    /**
     * @dev Reward successful treatment
     */
    function rewardTreatmentSuccess(
        address user, 
        string memory treatmentId
    ) external onlyAuthorizedMinter nonReentrant {
        require(user != address(0), "Invalid user address");
        require(totalSupply() + TREATMENT_SUCCESS_BONUS <= MAX_SUPPLY, "Max supply exceeded");

        lastActivityTime[user] = block.timestamp;

        _mint(user, TREATMENT_SUCCESS_BONUS);
        _updateUserTier(user);

        emit TreatmentSuccessRewarded(user, TREATMENT_SUCCESS_BONUS, treatmentId);
    }

    /**
     * @dev Update user tier based on token balance
     */
    function _updateUserTier(address user) internal {
        uint256 balance = balanceOf(user);
        uint256 oldTier = userTier[user];
        uint256 newTier = 0;

        if (balance >= TIER_4_THRESHOLD) {
            newTier = 4;
        } else if (balance >= TIER_3_THRESHOLD) {
            newTier = 3;
        } else if (balance >= TIER_2_THRESHOLD) {
            newTier = 2;
        } else if (balance >= TIER_1_THRESHOLD) {
            newTier = 1;
        }

        if (newTier != oldTier) {
            userTier[user] = newTier;
            emit TierUpdated(user, oldTier, newTier);
        }
    }

    /**
     * @dev Get tier-based cashback multiplier
     */
    function _getTierMultiplier(address user) internal view returns (uint256) {
        uint256 tier = userTier[user];
        if (tier == 4) return 150; // 50% bonus
        if (tier == 3) return 130; // 30% bonus
        if (tier == 2) return 120; // 20% bonus
        if (tier == 1) return 110; // 10% bonus
        return 100; // No bonus
    }

    /**
     * @dev Get user statistics
     */
    function getUserStats(address user) external view returns (
        uint256 tokenBalance,
        uint256 photos,
        uint256 detections,
        uint256 purchases,
        uint256 savings,
        uint256 tier,
        uint256 lastActivity
    ) {
        return (
            balanceOf(user),
            photoCount[user],
            diseaseDetections[user],
            totalPurchases[user],
            totalSavings[user],
            userTier[user],
            lastActivityTime[user]
        );
    }

    /**
     * @dev Calculate potential discount for purchase
     */
    function calculateDiscount(address user, uint256 purchaseAmount) external view returns (
        uint256 discountAmount,
        uint256 cashbackAmount,
        bool canAffordDiscount,
        uint256 tierMultiplier
    ) {
        discountAmount = (purchaseAmount * DISCOUNT_RATE) / 100;
        tierMultiplier = _getTierMultiplier(user);
        cashbackAmount = (purchaseAmount * CASHBACK_RATE * tierMultiplier) / 10000;
        canAffordDiscount = balanceOf(user) >= discountAmount;
    }

    /**
     * @dev Mint tokens (only authorized)
     */
    function mint(address to, uint256 amount) external onlyAuthorizedMinter {
        require(totalSupply() + amount <= MAX_SUPPLY, "Max supply exceeded");
        _mint(to, amount);
    }

    /**
     * @dev Burn tokens from address (only authorized)
     */
    function burnFrom(address account, uint256 amount) public override onlyAuthorizedBurner {
        super.burnFrom(account, amount);
    }

    /**
     * @dev Pause token transfers
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause token transfers
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Override transfer to include pause functionality
     */
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        super._beforeTokenTransfer(from, to, amount);
        require(!paused(), "Token transfers paused");
    }

    /**
     * @dev Emergency withdrawal (only owner)
     */
    function emergencyWithdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    /**
     * @dev Get contract information
     */
    function getContractInfo() external view returns (
        uint256 totalSupply_,
        uint256 maxSupply,
        uint256 photoReward,
        uint256 diseaseBonus,
        uint256 discountRate,
        uint256 cashbackRate
    ) {
        return (
            totalSupply(),
            MAX_SUPPLY,
            PHOTO_REWARD,
            DISEASE_BONUS,
            DISCOUNT_RATE,
            CASHBACK_RATE
        );
    }
}

